import React from "react";
import myImage from "../img/myImage.png";

class About extends React.Component {
  constructor() {
    super();
    this.state = {
      skills: [
        { id: "HTML5_skill", content: "HTML5", porcentage: "80%", value: "80" },
        { id: "CSS3_skill", content: "CSS3", porcentage: "75%", value: "75" },
        { id: "JavaScript_skill", content: "JavaScript", porcentage: "90%", value: "90" },
        { id: "PHP_skill", content: "PHP", porcentage: "70%", value: "70" },
        { id: "ReactJS_skill", content: "ReactJS", porcentage: "80%", value: "80" },
        { id: "Python_skill", content: "Python", porcentage: "75%", value: "75" },
        { id: "VanillaJS_skill", content: "VanillaJS", porcentage: "85%", value: "85" },
        { id: "Wordpress_skill", content: "Wordpress", porcentage: "80%", value: "80" }
      ],
      about_me: [
        { id: "first-p-about", content: "Je suis un développeur passionné..." },
        { id: "second-p-about", content: "J'ai acquis des compétences variées en développement web..." },
        { id: "third-p-about", content: "Toujours en quête de nouveaux défis techniques..." }
      ],
      formations: [
        {
          id: "webacademie",
          title: "WEB@CADÉMIE - EPITECH",
          year: "2023-2024",
          description: "Formation immersive Bac+2 en développement web."
        },
        {
          id: "42",
          title: "42",
          year: "2023",
          description: "Piscine immersive de 4 semaines en Langage C."
        },
        {
          id: "cnam",
          title: "CNAM",
          year: "2023",
          description: "Formation au CNAM de Bretagne en langage C/C++."
        },
        {
          id: "lycee",
          title: "Lycée Blanche de Castille",
          year: "2017 - 2020",
          description: "Baccalauréat : Filière scientifique, spécialité mathématique."
        }
      ]
    };
  }

  render() {
    return (
      <section id="about" className="about-mf sect-pt4 route">
        <div className="container">
          <div className="row">
            <div className="col-sm-12">
              <div className="box-shadow-full">
                <div className="row">
                  {/* SECTION MES FORMATIONS */}
                  <div className="col-md-12">
                    <div className="title-box-2">
                      <h5 className="title-left">Mes Formations</h5>
                    </div>
                    <ul className="list-group">
                      {this.state.formations.map(formation => (
                        <li key={formation.id} className="list-group-item bg-dark text-white border-0">
                          <h6 className="fw-bold">{formation.title} <span className="text-muted">({formation.year})</span></h6>
                          <p>{formation.description}</p>
                        </li>
                      ))}
                    </ul>
                  </div>

                  {/* SECTION À PROPOS DE MOI & COMPÉTENCES */}
                  <div className="col-md-6">
                    <div className="about-me pt-4 pt-md-0">
                      <div className="title-box-2">
                        <h5 className="title-left">À propos de moi</h5>
                      </div>
                      {this.state.about_me.map(content => (
                        <p className="lead" key={content.id}>{content.content}</p>
                      ))}
                    </div>
                  </div>

                  <div className="col-md-6">
                    <div className="skill-mf">
                      <p className="title-s">Compétences</p>
                      {this.state.skills.map(skill => (
                        <React.Fragment key={skill.id}>
                          <span>{skill.content}</span>
                          <span className="pull-right">{skill.porcentage}</span>
                          <div className="progress">
                            <div
                              className="progress-bar"
                              role="progressbar"
                              style={{ width: skill.porcentage }}
                              aria-valuenow={skill.value}
                              aria-valuemin="0"
                              aria-valuemax="100"
                            ></div>
                          </div>
                        </React.Fragment>
                      ))}
                    </div>
                  </div>
                </div> {/* Fin row */}
              </div> {/* Fin box-shadow-full */}
            </div>
          </div>
        </div>
      </section>
    );
  }
}

export default About;
